import React from "react";
import {checklistTypes} from "../data";

function Account({filterChecklistTypes}) {
  return (
    <div>
      {checklistTypes.map((checklistType, index) => {
        return (
          <button
            className="btn-category"
            key={index}
            onClick={() => {
              filterChecklistTypes(checklistType);
            }}
          >
            {checklistType}
          </button>
        )
      })}
    </div>
  )
}

export default Account;
